CREATE TABLE `Booking_Statuses` (
    `user_id` NUMERIC(4, 1),
    `user_name` VARCHAR(14) CHARACTER SET utf8,
    `password` VARCHAR(11) CHARACTER SET utf8,
    `name` VARCHAR(18) CHARACTER SET utf8,
    `phone` NUMERIC(11, 1),
    `email` VARCHAR(27) CHARACTER SET utf8,
    `address` VARCHAR(22) CHARACTER SET utf8,
    `created_by` VARCHAR(5) CHARACTER SET utf8,
    `create_date` DATETIME,
    `modified_by` VARCHAR(5) CHARACTER SET utf8,
    `modified_date` DATETIME
);
